const dispatchToProps=dispatch=>{
    return{
        add:(name)=>{
            dispatch({
                type:"ADD",
                item:{name}
            });
        }
    }
}
const stateToProps=state=>{
    return{
        items:state
    }
}
const About=props=>{
    return(
        <div>
            <p>This website help you to find the places that famous in the city that you choose to visit.</p>
        </div>
    )
}
export default About;
